INSERT INTO `event_details` VALUES
(16,NULL,'Welcome to Driftwood: By The Beach',NULL,'2025-01-28','2025-02-18','10:25:07','07:59:07','Ahoy! Come and join us By The Beach! We\'re excited to have you as our first ever batch of users on Driftwood! Our very first event is open for all to join!\n\nGather your friends and form your team to join this 5v5 Dota 2 tournament! Compete in best-of-three (BO3) double elimination rounds and play your way to the top!\n\nWith an entry fee of only RM25 per team, 8 teams will compete for a RM500 prize pool:\n\n1st place - RM200\n2nd place - RM150\n3rd place - RM100\n4th place - RM50\n5th place - RM25\n6th place - RM25\n\nOnce you have formed your team and signed up, you\'ll have to confirm your slot by fulfilling two criteria:\n\n1. Select your roster for this tournament\nYour team can have more than 5 players, but you must choose which 5 players will be on your roster for this tournament. Choose wisely - after you have confirmed your slot, you won\'t be able to change your roster anymore!\n\n2. Pay the full entry fee\nFull entry fee payment must be completed in order to confirm your team\'s slot. You can choose to divide the entry fee evenly amongst all players in your roster, or pay it up in any split you like - it\'s up to you!\n\nSignups for this tournament will be open until 15 May 2025. You must confirm your slot by 19 May 2025 or your registration will be forfeited. And don\'t worry, in case the tournament doesn\'t happen, you\'ll be fully refunded.\n\nOnce the tournament starts, you can choose to play your matches with your opponent at any time within the allocated time window. Get in contact with your opponent to find a time that works best for you! As long as you report the results of your matches within the reporting window, you\'re all good! Look at the bracket tab in the event page to see where you need to report your results.\n\nSign up now! Will you be the winning team?','images/events/eventBanner-1764590880-1.png','\"Dota 2,esports,gaming,competition\"','ENDED','Southeast Asia',NULL,NULL,'public',17,'2025-12-01 05:57:13','2025-12-02 15:43:22',1,1,2,1,40),
(17,NULL,'Welcome to Driftwood: Around The Bonfire',NULL,'2025-01-20','2025-02-10','00:14:03','09:35:29','Ahoy! Come and gather Around The Bonfire! To get the ball rolling for our closed beta launch, Driftwood is running our first few events just for you!\n\nGather your friends and form your team to join this 5v5 Dota 2 tournament! Compete in best-of-three (BO3) double elimination rounds and play your way to the top!\n\nWith an entry fee of only RM25 per team, 8 teams will compete for a RM500 prize pool:\n\n1st place - RM200\n2nd place - RM150\n3rd place - RM100\n4th place - RM50\n5th place - RM25\n6th place - RM25\n\nOnce you have formed your team and signed up, you\'ll have to confirm your slot by fulfilling two criteria:\n\n1. Select your roster for this tournament\nYour team can have more than 5 players, but you must choose which 5 players will be on your roster for this tournament. Choose wisely - after you have confirmed your slot, you won\'t be able to change your roster anymore!\n\n2. Pay the full entry fee\nFull entry fee payment must be completed in order to confirm your team\'s slot. You can choose to divide the entry fee evenly amongst all players in your roster, or pay it up in any split you like - it\'s up to you!\n\nSignups for this tournament will be open until 29 May 2025. You must confirm your slot by 2 June 2025 or your registration will be forfeited. And don\'t worry, in case the tournament doesn\'t happen, you\'ll be fully refunded.\n\nOnce the tournament starts, you can choose to play your matches with your opponent at any time within the allocated time window. Get in contact with your opponent to find a time that works best for you! As long as you report the results of your matches within the reporting window, you\'re all good! Look at the bracket tab in the event page to see where you need to report your results.\n\nSign up now! Will you be the winning team?','images/events/eventBanner-1764591133-1.png','\"Dota 2,esports,gaming,competition\"','SCHEDULED','Southeast Asia',NULL,NULL,'public',17,'2025-12-01 06:10:44','2025-12-02 15:43:36',1,1,2,0,42),
(18,NULL,'Grand Chess Championship','elite-chess-circuit','2025-01-09','2025-01-30','14:30:45','10:46:06','Ready to outmaneuver your opponents? The Elite Chess Circuit is calling all strategic minds!\n\nJoin us for an intense chess competition where every move counts! This tournament brings together the sharpest players for tactical battles that will test your planning, patience, and prowess.\n\nWith an entry fee of just RM20 per player, 16 competitors will battle for a RM600 prize pool:\n\n1st place - RM250\n2nd place - RM175\n3rd place - RM100\n4th place - RM50\n5th-8th place - RM25 each\n\nOnce you\'ve registered, confirm your spot by completing payment before the deadline. All matches will follow standard chess tournament rules with a time control format to keep things exciting!\n\nRegistration opens now and closes on January 5th, 2025. Payment confirmation required by January 7th, 2025. If the tournament doesn\'t reach minimum participants, full refunds will be issued.\n\nMatches can be scheduled flexibly within designated time windows - coordinate with your opponent to find the perfect time. Remember to report your results promptly after each game!\n\nWill you claim the title of Elite Champion?','images/events/eventBanner-1764676107-1.jpg','\"Chess,esports,gaming,competition\"','SCHEDULED','Southeast Asia',NULL,NULL,'public',17,'2025-12-01 06:15:55','2025-12-02 15:44:26',2,3,6,1,72),
(19,NULL,'Welcome to Driftwood: Dota 2',NULL,'2024-12-08','2024-12-29','09:33:14','18:20:32','Ahoy! Come and splash about In The Ocean! We\'re always happy to have you on Driftwood! And we hope to see you in many more events to come! \n\nGather your friends and form your team to join this 5v5 Dota 2 tournament! Compete in best-of-three (BO3) double elimination rounds and play your way to the top!\n\nWith an entry fee of only RM25 per team, 8 teams will compete for a RM500 prize pool:\n\n1st place - RM200\n2nd place - RM150\n3rd place - RM100\n4th place - RM50\n5th place - RM25\n6th place - RM25\n\nOnce you have formed your team and signed up, you\'ll have to confirm your slot by fulfilling two criteria:\n\n1. Select your roster for this tournament\nYour team can have more than 5 players, but you must choose which 5 players will be on your roster for this tournament. Choose wisely - after you have confirmed your slot, you won\'t be able to change your roster anymore!\n\n2. Pay the full entry fee\nFull entry fee payment must be completed in order to confirm your team\'s slot. You can choose to divide the entry fee evenly amongst all players in your roster, or pay it up in any split you like - it\'s up to you!\n\nSignups for this tournament will be open until 12 June 2025. You must confirm your slot by 16 June 2025 or your registration will be forfeited. And don\'t worry, in case the tournament doesn\'t happen, you\'ll be fully refunded.\n\nOnce the tournament starts, you can choose to play your matches with your opponent at any time within the allocated time window. Get in contact with your opponent to find a time that works best for you! As long as you report the results of your matches within the reporting window, you\'re all good! Look at the bracket tab in the event page to see where you need to report your results.\n\nSo sign up now! Will you be the winning team?','images/events/eventBanner-1764603612-1.png','\"Dota 2,esports,gaming,competition\"','SCHEDULED','Southeast Asia',NULL,NULL,'public',17,'2025-12-01 06:56:43','2025-12-02 15:45:41',1,1,2,0,50),
(20,NULL,'Premier Football League','premier-football-league','2025-07-31','2025-08-21','01:02:26','17:44:07','Kick off your FIFA journey with the Premier Football League!\n\nAre you ready to dominate the virtual pitch? Join us for an action-packed FIFA tournament where skill, strategy, and quick reflexes will determine who rises to the top!\n\nWith an entry fee of only RM15 per player, 32 players will compete for a massive RM800 prize pool:\n\n1st place - RM300\n2nd place - RM200\n3rd place - RM150\n4th place - RM75\n5th place - RM50\n6th-8th place - RM25 each\n\nAfter signing up, secure your spot by completing the entry fee payment. You\'ll compete in intense matches using the latest FIFA roster updates!\n\nSignups are open until July 27th, 2025. Payment confirmation deadline is July 29th, 2025. Don\'t worry - if we don\'t hit our minimum player count, you\'ll receive a full refund.\n\nSchedule your matches with opponents during the allocated time windows. Communication is key! Make sure to report match results within the reporting period to avoid penalties.\n\nAre you the next FIFA champion?','images/events/eventBanner-1764676120-1.jpg','\"FIFA,esports,gaming,competition\"','SCHEDULED','Southeast Asia',NULL,NULL,'public',17,'2025-12-01 06:58:12','2025-12-02 15:45:43',2,3,4,1,64),
(21,NULL,'Welcome to Driftwood: In The Ocean',NULL,'2025-01-22','2025-02-12','09:39:47','05:45:21','Ahoy! Come and splash about In The Ocean! We\'re always happy to have you on Driftwood! And we hope to see you in many more events to come! \n\nGather your friends and form your team to join this 5v5 Dota 2 tournament! Compete in best-of-three (BO3) double elimination rounds and play your way to the top!\n\nWith an entry fee of only RM25 per team, 8 teams will compete for a RM500 prize pool:\n\n1st place - RM200\n2nd place - RM150\n3rd place - RM100\n4th place - RM50\n5th place - RM25\n6th place - RM25\n\nOnce you have formed your team and signed up, you\'ll have to confirm your slot by fulfilling two criteria:\n\n1. Select your roster for this tournament\nYour team can have more than 5 players, but you must choose which 5 players will be on your roster for this tournament. Choose wisely - after you have confirmed your slot, you won\'t be able to change your roster anymore!\n\n2. Pay the full entry fee\nFull entry fee payment must be completed in order to confirm your team\'s slot. You can choose to divide the entry fee evenly amongst all players in your roster, or pay it up in any split you like - it\'s up to you!\n\nSignups for this tournament will be open until 12 June 2025. You must confirm your slot by 16 June 2025 or your registration will be forfeited. And don\'t worry, in case the tournament doesn\'t happen, you\'ll be fully refunded.\n\nOnce the tournament starts, you can choose to play your matches with your opponent at any time within the allocated time window. Get in contact with your opponent to find a time that works best for you! As long as you report the results of your matches within the reporting window, you\'re all good! Look at the bracket tab in the event page to see where you need to report your results.\n\nSo sign up now! Will you be the winning team?','images/events/eventBanner-1764603824-1.png','\"Dota 2,esports,gaming,competition\"','SCHEDULED','Hanoi, Vietnam',NULL,NULL,'public',17,'2025-12-01 09:40:45','2025-12-02 08:29:53',2,1,2,0,62),
(22,NULL,'Phantom Force Championship','phantom-force-championship','2025-05-17','2025-06-07','23:47:52','21:32:03','Agents, assemble! The Phantom Force Championship needs your tactical expertise!\n\nStep into the battlefield for an explosive Valorant tournament! Gather your squad of 5 and showcase your aim, strategy, and teamwork in this competitive 5v5 tournament format.\n\nWith a team entry fee of just RM30, 12 teams will fight for a RM750 prize pool:\n\n1st place - RM300\n2nd place - RM200\n3rd place - RM150\n4th place - RM75\n5th-6th place - RM37.50 each\n\nForm your team and register, then confirm your participation by selecting your tournament roster (you can have substitutes!) and paying the full entry fee. Split it however works for your team!\n\nRegistration closes on May 13th, 2025. Roster lock and payment confirmation by May 15th, 2025. Full refunds provided if tournament doesn\'t proceed.\n\nCoordinate with opposing teams to schedule matches within the designated time windows. All games will be played in a competitive map pool. Report your results on time to keep the tournament running smoothly!\n\nCan your team clutch the championship?','images/events/eventBanner-1764676232-1.png','\"Valorant,esports,gaming,competition\"','SCHEDULED','Petaling Jaya, Malaysia',NULL,NULL,'public',17,'2025-12-01 09:55:17','2025-12-02 08:29:53',2,1,7,1,66),
(23,NULL,'Global Offensive Masters','global-offensive-masters','2025-02-22','2025-03-15','22:45:27','09:26:42','Counter-terrorists and terrorists unite! The Global Offensive Masters tournament is here!\n\nJoin the ultimate CS:GO showdown! Assemble your 5-player team and prove you have what it takes to be crowned masters of the game. Compete in thrilling best-of-one (BO1) matches leading to BO3 finals!\n\nWith a team entry fee of RM35, 16 teams will battle for a RM1,000 prize pool:\n\n1st place - RM400\n2nd place - RM250\n3rd place - RM175\n4th place - RM100\n5th-8th place - RM50 each\n\nOnce registered, lock in your 5-player roster (subs allowed!) and complete payment to confirm. The entry fee can be split among teammates however you choose!\n\nSignups close February 18th, 2025. Confirm your slot by February 20th, 2025. If minimum teams aren\'t reached, full refunds will be issued.\n\nSchedule matches with opponents within time windows. All matches use active duty map pool with knife round for side selection. Submit match results promptly!\n\nWill you defuse the competition?','images/events/eventBanner-1764676249-1.png','\"CSGO,esports,gaming,competition\"','SCHEDULED','Kuching, Malaysia',NULL,NULL,'public',17,'2025-12-01 09:55:28','2025-12-02 08:29:53',2,2,15,1,68),
(24,NULL,'Legends Clash League','legends-clash-league','2025-03-09','2025-03-30','22:20:14','23:58:29','Welcome to the battlefield, Legends! The Legends Clash League is calling mobile MOBA champions!\n\nGather your squad for the ultimate Mobile Legends: Bang Bang tournament! Form your 5-player team and dominate the Land of Dawn in this competitive tournament featuring intense 5v5 battles.\n\nWith a team entry fee of only RM25, 10 teams will compete for a RM550 prize pool:\n\n1st place - RM225\n2nd place - RM150\n3rd place - RM100\n4th place - RM50\n5th place - RM25\n\nRegister your team, then confirm by selecting your tournament roster (up to 2 subs allowed) and completing payment. Divide the entry fee among your team as you see fit!\n\nRegistration period ends March 5th, 2025. Roster and payment confirmation by March 7th, 2025. Full refunds if tournament is cancelled.\n\nCoordinate match schedules with opponents during allocated windows. All games follow standard ranked rules with draft pick mode. Report results within the specified timeframe!\n\nCan you achieve Mythical Glory in this tournament?','images/events/eventBanner-1764676443-1.png','\"MLBB,esports,gaming,competition\"','SCHEDULED','Cyberjaya, Malaysia',NULL,NULL,'public',17,'2025-12-01 09:55:51','2025-12-02 08:29:53',2,1,16,1,78),
(25,NULL,'Summer Valorant Cup','summer-valorant-cup','2025-01-28','2025-02-18','19:52:55','11:13:56','The Summer Valorant Cup is heating up! Time to show off your tactical FPS skills!\n\nCalling all Valorant enthusiasts! Form your dream team of 5 and compete in this summer showdown. Navigate through single elimination rounds with best-of-three matches in the finals!\n\nWith a team entry fee of RM28, 8 teams will compete for a RM500 prize pool:\n\n1st place - RM200\n2nd place - RM140\n3rd place - RM90\n4th place - RM50\n5th-6th place - RM20 each\n\nAfter registration, lock in your roster (substitutes permitted) and complete the entry fee payment. Your team decides how to split the cost!\n\nSignups close January 24th, 2025. Confirmation deadline is January 26th, 2025. Cancellation means full refunds for everyone.\n\nWork with opposing teams to schedule within time windows. Matches use competitive map rotation. Make sure to report scores on time!\n\nReady to ace your way to victory?','images/events/eventBanner-1764676499-1.png','\"Valorant,esports,gaming,competition\"','SCHEDULED','Southeast Asia',NULL,NULL,'public',17,'2025-12-01 09:57:56','2025-12-02 15:45:46',1,1,7,1,74),
(26,NULL,'Legends Combat Series','legends-combat-series','2025-04-04','2025-04-25','03:40:36','12:16:12','Heroes arise! The Legends Combat Series beckons the bravest MOBA warriors!\n\nJoin us for an epic Honor of Kings tournament! Assemble your 5-player team and prove your mastery in strategic team battles. Navigate through double elimination brackets with BO3 format!\n\nWith a team entry fee of RM30, 8 teams will fight for a RM550 prize pool:\n\n1st place - RM220\n2nd place - RM150\n3rd place - RM100\n4th place - RM50\n5th-6th place - RM30 each\n\nRegister and then confirm by finalizing your roster (subs welcome!) and paying the entry fee. Split it among teammates as preferred!\n\nRegistration ends April 1st, 2025. Final confirmation by April 3rd, 2025. Full refunds issued if tournament doesn\'t proceed.\n\nSchedule matches with opponents flexibly within designated periods. All games use draft pick mode with competitive settings. Report results promptly after each match!\n\nWill your team achieve legendary status?','images/events/eventBanner-1764676618-1.png','\"HonorofKings,esports,gaming,competition\"','SCHEDULED','Southeast Asia',NULL,NULL,'public',17,'2025-12-01 09:59:20','2025-12-02 15:47:56',2,1,9,1,76),
(27,NULL,'Rift Masters Series','rift-masters-series','2025-06-09','2025-06-30','07:27:55','02:19:10','Summoners! The Rift Masters Series is your chance to prove dominance on Wild Rift!\n\nGather your team for the ultimate League of Legends: Wild Rift mobile tournament! Form your 5-player squad and battle through double elimination brackets in this competitive showcase.\n\nWith a team entry fee of just RM32, 12 teams will compete for a RM750 prize pool:\n\n1st place - RM300\n2nd place - RM200\n3rd place - RM125\n4th place - RM75\n5th-6th place - RM50 each\n\nAfter signing up, confirm your spot by locking your roster (up to 2 subs allowed) and completing payment. Decide among yourselves how to split the fee!\n\nSignups close June 5th, 2025. Confirmation required by June 7th, 2025. Tournament cancellation means full refunds.\n\nCoordinate with opponents to schedule matches in allocated time slots. All matches use draft pick with competitive bans. Submit results within reporting windows!\n\nCan you master the rift?','images/events/eventBanner-1764676660-1.png','\"LOL,esports,gaming,competition\"','SCHEDULED','Southeast Asia',NULL,NULL,'public',17,'2025-12-01 10:00:38','2025-12-02 15:48:08',2,2,8,0,80),
(61,NULL,'Spring FIFA Battle Royale','spring-8-team-battle','2025-04-04','2025-04-25','13:50:04','16:47:55','Spring into action with the Spring 8-Team Battle!\n\nGet ready for fast-paced FIFA team competition! This unique tournament features 8 teams of 3 players each, competing in a team-based format where coordination and individual skill both matter.\n\nWith a team entry fee of RM20, 8 teams (24 players total) will compete for a RM400 prize pool:\n\n1st place - RM160\n2nd place - RM110\n3rd place - RM70\n4th place - RM40\n5th-6th place - RM20 each\n\nRegister your 3-player team, then confirm by completing payment and roster selection. Your team chooses how to divide the entry fee!\n\nRegistration closes March 31st, 2025. Payment confirmation by April 2nd, 2025. Full refunds if minimum teams aren\'t met.\n\nSchedule matches flexibly with opponents during designated windows. Each matchup is best-of-three with different team members playing. Report all results promptly!\n\nWill your trio reign supreme?','images/events/eventBanner-1764676860-1.webp','\"FIFA,esports,gaming,competition\"','SCHEDULED','Southeast Asia',NULL,NULL,'public',17,'2025-12-01 10:29:11','2025-12-02 15:48:30',2,1,4,0,172),
(62,NULL,'Penang FIFA Champions League','penang-fifa-champions-league','2025-05-05','2025-05-26','06:12:36','23:01:54','Welcome to the Penang FIFA Champions League!\n\nGet ready for an epic 16-team FIFA tournament taking place in the heart of Penang! This championship brings together the best FIFA players in a competitive single elimination format with BO3 semifinals and finals.\n\nWith a team entry fee of RM25, 16 teams of 2 players each will battle for a RM750 prize pool:\n\n1st place - RM300\n2nd place - RM200\n3rd place - RM125\n4th place - RM75\n5th-8th place - RM50 each\n\nRegister your 2-player team, then lock in your roster and complete payment. Split the fee however works for your duo!\n\nSignups close May 1st, 2025. Confirmation deadline May 3rd, 2025. Cancellations result in full refunds.\n\nCoordinate match times with opponents within provided windows. Tag-team format means both players participate! Report results after each series!\n\nCan your partnership conquer Penang?','images/events/eventBanner-1764685536-1.jpg','\"FIFA,esports,gaming,competition\"','SCHEDULED','Penang, Malaysia',NULL,NULL,'public',17,'2025-12-01 10:29:24','2025-12-02 08:34:53',2,2,4,1,174),
(63,NULL,'FIFA Grand Championship','kuching-fifa-grand-championship','2025-06-27','2025-07-18','12:08:36','07:24:41','The most prestigious FIFA event in Sarawak! Welcome to the Kuching FIFA Grand Championship!\n\nThis is the ultimate FIFA tournament experience! 32 elite teams competing in our largest invitational event. Navigate through Swiss system group stages followed by intense single elimination playoffs!\n\nWith a team entry fee of RM40, 32 teams of 4 players each will compete for a massive RM2,000 prize pool:\n\n1st place - RM800\n2nd place - RM500\n3rd place - RM300\n4th place - RM200\n5th-8th place - RM100 each\n9th-16th place - RM50 each\n\nRegister your 4-player squad, select your starting lineup (1 sub allowed), and complete payment. Decide as a team how to split the entry fee!\n\nThis is an invitational championship event - signups close June 23rd, 2025. Confirmation required by June 25th, 2025. Full refunds if tournament doesn\'t proceed.\n\nMatch scheduling is crucial with multiple rounds. Coordinate carefully with opponents. Different team members can play different matches. Report results accurately and on time!\n\nDo you have what it takes to become the Kuching Grand Champion?','images/events/eventBanner-1764685458-1.webp','\"FIFA,esports,gaming,competition\"','SCHEDULED','Southeast Asia',NULL,NULL,'public',17,'2025-12-01 10:29:28','2025-12-02 15:49:41',2,3,4,0,176);
