(2,'Worlds 2025 Zip Hoodie','worlds-2025-zip-hoodie','This item typically ships within 2 weeks from purchase.',85,'Featuring the iconic Worlds crest in subtle, almost hidden embossed logo, this limited-edition hoodie blends comfort, style, and championship pride, perfect for game day or everyday wear.\n\nFeatures:\n\n- Custom 570 gsm French Terry scuba hoodie\n- Left chest and arm hem high density silicone heat transfer logo\n- Custom woven clip label at bottom left hem\n- Large back tonal embossed logo\n- Heat transfer reflective print on back',1,'images/products/01KB67BFM926XR6MXEWW1SHY53.jpg','[\"images\\/products\\/gallery\\/01KB67BFMEGM4NS67SZG5DHC08.webp\"]','2025-11-28 15:54:19','2025-11-28 15:54:19',1),
(3,'Worlds 2025 XL Mousepad','worlds-2025-xl-mousepad',NULL,25,'Celebrate 15 years of Lol Esports with the official Worlds 2025 XL Mousepad.\n\nApproximate Dimensions:\n\nWidth: 31.3 in / 79.5 cm\nHeight: 11.8 in / 30 cm',1,'images/products/01KB7G3WRDK6YETX11B53BVP6P.jpg','[\"images\\/products\\/gallery\\/01KB7G3WRM7HVR5909QSZ3FRCH.webp\",\"images\\/products\\/gallery\\/01KB7G3WSWY6YF63B86X6K4R8Q.webp\",\"images\\/products\\/gallery\\/01KB7G3WT1PBST3Z2ZMFPE0V8J.webp\"]','2025-11-29 03:46:42','2025-11-29 03:47:35',1),
(4,'Worlds 2025 Glaive Tee','worlds-2025-glaive-tee',NULL,35,'Celebrate 15 years of Lol Esports with the official Worlds 2025 Glaive Tee.\n\nFeatures:\n\n- Custom 30/1s 180 gsm 100% cotton\n- Custom interior center back woven label.\n- Reflective heat transfer detail on front left bottom hem and center back\n- Softhand plastisol screenprinted graphics on center back print\n- Custom woven clip label at bottom left hem',1,'images/products/01KB7GAVCHHP45DVWJ6RG1PY54.jpg','[\"images\\/products\\/gallery\\/01KB7GAVCSSTKYGG61QACTPEWZ.webp\",\"images\\/products\\/gallery\\/01KB7GAVCZ9ST0TWBKDBXQGNA2.webp\"]','2025-11-29 03:50:30','2025-11-29 03:50:30',1),
(5,'Chibi Champions Dad Hat','chibi-champions-dad-hat','This item typically ships within 2 weeks from purchase.',30,'The Chibi Champions Dad Hat shows off a lineup of fan-favorite champions in playful chibi style, with a lovable Poro on the back for a finishing touch.\n\nFeatures:\n\n- Custom 5 panel black cap\n- 230 gsm 100% twill cotton\n- Center front heat transfer chibi graphic\n- Center back embroidered Poro detail',1,'images/products/01KB7GP1H0GR5RCGH21PY42YZP.jpg','[\"images\\/products\\/gallery\\/01KB7GP1HB1FGXSSMPV74DKGVA.webp\",\"images\\/products\\/gallery\\/01KB7GP1HH0TAHEAJ952TC564Y.webp\",\"images\\/products\\/gallery\\/01KB7GP1HPPH7MY0SZS5AFSXM4.webp\"]','2025-11-29 03:56:37','2025-11-29 04:06:30',1),
(6,'Worlds 2025 Jersey','worlds-2025-jersey','This item typically ships within 2 weeks from purchase.',75,'Designed with a sleek V-neck cut and bold Worlds branding, this limited-edition piece blends performance and style.\n\nFeatures:\n\n- Custom 165 gsm 100% polyester\n- Contrast rib at neck opening\n- Heat Transfer details and sublimation print on front and back\n- Jersey mesh paneling details at armholes\n- Custom woven clip label at bottom left hem',1,'images/products/01KB7H13SZKAW3GBZDMRP02XHZ.jpg','[\"images\\/products\\/gallery\\/01KB7H13T2F8WB51HE741MA038.webp\",\"images\\/products\\/gallery\\/01KB7H13T6BBAW6WQR4V6P95WV.webp\"]','2025-11-29 04:02:40','2025-11-29 04:02:40',1),
(7,'RockLove Spirit Blossom Syndra Hoop Earrings','rocklove-spirit-blossom-syndra-hoop-earrings','The League of Legends | RockLove SPIRIT BLOSSOM Collector\'s Box: This jewelry collection arrives in a signature League of Legends | RockLove SPIRIT BLOSSOM Collector\'s Box, with soft pastel and gold metallic details throughout: a compelling addition to an',100,'Handcrafted in gleaming 14K yellow gold plated nickel-free artisan brass, the Spirit Blossom Syndra Hoop Earrings are a delightfully elegant accessory embodying everything the Spirit of Freedom represents.\n\nThe round hoops showcase a cutout lotus flower design adorned with two intricately detailed butterflies perched on the outer rim. Each butterfly features engraved scrollwork and is accented with two sparkling white cubic zirconia crystals.\n\nThe hoops are secured with 14K yellow gold plated nickel-free sterling silver hinged ear wires and offer a lightweight, comfortable fit perfect for everyday wear.\n\nFeatures:\n\n- Officially licensed League of Legends product\n- Nickel-free artisan brass, cubic zirconia crystals\n- 14K yellow gold plated finish\n- 4 grams per earring\n- 35mm diameter (40mm including butterflies)',1,'images/products/01KB7HGZ9DE7AVGHDH7BDVZCFB.jpg','[\"images\\/products\\/gallery\\/01KB7HGZ9NRVSD4CPNGWV3R9XQ.webp\",\"images\\/products\\/gallery\\/01KB7HGZ9TF2468R8W53KEMKNP.webp\",\"images\\/products\\/gallery\\/01KB7HGZ9Y68R25A0XPA19EQ4W.webp\"]','2025-11-29 04:11:20','2025-11-29 04:11:20',1),
(8,'Rainbow Lux Hat','rainbow-lux-hat',NULL,30,'Well, a double rainbow is a phenomenon of optics that displays a spectrum of light due to the sun shining on droplets of moisture in the atmosphere. Does that expl- BLEEHH GAAK\n\nSometimes, rainbows appear when (and where) you least expect it. Capture those spontaneous moments of colorful brilliance with our Rainbow Lux Hat!\n\nFeatures:\n\n- Custom 5 panel adjustable 100% cotton twill hat\n- Center front and side panel embroidered rainbow Lux emblem',1,'images/products/01KB7HPMSXNJQQ8CY217BYZ37H.jpg','[\"images\\/products\\/gallery\\/01KB7HPMT1GFK6MWV132XC8Y9X.webp\",\"images\\/products\\/gallery\\/01KB7HPMT6096ZQ3NPYK01DXG9.webp\",\"images\\/products\\/gallery\\/01KB7HPMTBVE69CR91FR4WJGVZ.webp\"]','2025-11-29 04:14:25','2025-11-29 04:14:25',1),
(9,'First Stand 2025 Hoodie','first-stand-2025-hoodie',NULL,75,'Forge a new path to victory; whether it be through brute force, elite mental, sheer creativity or deft mechanics. This is your chance to find the joy of invention and show the world, and yourself what you\'ve got.\n\nKick off a new age of LoL Esports with the inaugural First Stand Tournament merch collection and the official First Stand 2025 Hoodie.\n\nFeatures:\n\n- 570 gsm custom paneled hoodie with kangaroo pocket\n- 100% cotton french terry\n- Custom First Stand emblem screenprints\n- Custom 3D embroidered and woven First Stand embellishments',1,'images/products/01KB7HX8JXSBQXJYAGCC114A0P.jpg','[\"images\\/products\\/gallery\\/01KB7HX8K74QAX05BZJEV0E58K.webp\",\"images\\/products\\/gallery\\/01KB7HYDVMDG608XYC4NRX9TYP.webp\"]','2025-11-29 04:18:02','2025-11-29 04:18:40',1),
(10,'Worlds 2024 Scarf','worlds-2024-scarf',NULL,27,'Worlds is upon us. The pinnacle of LoL Esports has never just been a tournament. Teams and pros aren\'t here just to raise a trophy - they\'re here to make those feel something. They\'re here to make them believe.\n\nBelieve in the moment with the Worlds 2024 Scarf.\n\nFeatures:\n\n-100% acrylic, double-faced jacquard\n\nApproximate Measurements:\n\n- Length: 52 in / 133 cm\n- Width: 7.1 in / 18 cm',1,'images/products/01KB7J2XPQV6ZA708SPHGHA74J.jpg','[\"images\\/products\\/gallery\\/01KB7J2XPT3M3Z2MJJ0E9ER45P.webp\",\"images\\/products\\/gallery\\/01KB7J2XPZ1ESWSAY9PDJ0VV54.webp\",\"images\\/products\\/gallery\\/01KB7J2XQ2EBPZK9PCMVYFP7WF.webp\"]','2025-11-29 04:21:08','2025-11-29 04:21:08',1),
(11,'Chibi Yasuo Tee','chibi-yasuo-tee',NULL,30,'The Chibi Yasuo Tee captures the Unforgiven in a playful style that every player will recognize.\n\nAdmired by mains, dreaded by teammates, Yasuo is equal parts legend and meme, and this tee lets you wear that reputation proudly in chibi form.\n\nFeatures:\n\n- Custom 100% cotton 30/1s tee\n- Garment-dyed\n- Softhand plastisol screenprinted Yasuo graphics on front left chest and center back',1,'images/products/01KB7JB7RJQAWE43SV7F8CE75J.jpg','[\"images\\/products\\/gallery\\/01KB7JB7RXTBANGE9HGEY9FVCP.webp\",\"images\\/products\\/gallery\\/01KB7JB7S00VGD8CG8YRVM6H49.webp\"]','2025-11-29 04:25:40','2025-11-29 04:25:40',1),
(12,'FRGMT Cap','vlrnt-frgmt-cap','This item typically ships within 2 weeks from purchase.',24,'VALORANT meets fragment for a limited-edition merch collection and in-game bundle.\n\nDinked, but not down.\n\nFeatures:\n\n- Custom 6 panel cap\n- 230 gsm 100% twill cotton\n- Front and back embroidered VALORANT Champions Paris graphics',1,'images/products/01KB7JGN8Y5JADE0FSRBXMXN5Y.jpg','[\"images\\/products\\/gallery\\/01KB7JGNAAW2YZNBXY2KSTS3BJ.webp\",\"images\\/products\\/gallery\\/01KB7JGNAD2QCH6ZMKX889Z6ET.webp\",\"images\\/products\\/gallery\\/01KB7JGNAFK245JBHS81BH1474.webp\"]','2025-11-29 04:28:38','2025-11-29 04:28:38',1),
(13,'RockLove VALORANT Chamber Chain','rocklove-valorant-chamber-chain','This item typically ships within 1 month from purchase.',180,'A statement in both design and function, the VALORANT Chamber Chain embodies Chambers signature blend of sophistication and strength.\n\nHandcrafted in durable, nickel-free artisan brass and thickly plated in warm, polished 14K yellow gold, this versatile piece features a striking combination of chains: a custom wide, flat double-snake chain paired with a heavy curb chain for contrasting texture and shine. The 20 inch necklace secures with an oversized lobster clasp laser engraved with the VALORANT V logo.\n\nFour detachable clip charms, each engraved with one of Chambers ability icons, can be added, removed, and rearranged along the chain, allowing the wearer to fully customize their look. A clever blend of engineering and silicone inlay ensures each clip stays exactly where placed, maintaining perfect spacing without sliding or shifting.\n\nProduct Details\n\n- Four removable clips featuring Chamber ability icons for customizable placement\n- Nickel-free artisan brass\n- 14K yellow gold plated finish\n- 20 inch overall length\n- 7mm wide snake and curb chains, 8mm x 7mm clips\n\nThis jewelry collection arrives in a signature VALORANT | RockLove Collectors Box, featuring bold warm red and cool grey branding both inside and out. The packaging is accented by soft black flocking to the jewelry, making it a compelling addition to any display case.',1,'images/products/01KB7PBCVC7KDSGRZP80C9T1X1.jpg','[\"images\\/products\\/gallery\\/01KB7PBCVG5RVB291G74W907B5.webp\",\"images\\/products\\/gallery\\/01KB7PBCVMAWTC7SECNQ18A2PP.webp\"]','2025-11-29 05:35:40','2025-11-29 05:35:40',1),
(14,'FRGMT Sweatpants','vlrnt-frgmt-sweatpants',NULL,138,'VALORANT meets fragment for a limited-edition merch collection and in-game bundle.\n\nComfy bottoms for top fragging.\n\nFeatures:\n\n- Custom heavyweight, reactive-dyed sweats\n- 410 gsm 100% cotton French terry\n- Elastic waistband with drawstring\n- Custom woven interior center back label\n- Softhand plastisol logo hit on upper left leg\n- Side flush seam welt pockets',1,'images/products/01KB7PKW3P6Q7AV0XZ8DP0SR5T.jpg','[\"images\\/products\\/gallery\\/01KB7PKW3W0KBW7FS619QXM0G6.webp\",\"images\\/products\\/gallery\\/01KB7PKW410RRQ557NHAHZ2ETQ.webp\",\"images\\/products\\/gallery\\/01KB7PKW425XKWGK8Y3VQP170V.webp\",\"images\\/products\\/gallery\\/01KB7PKW44DGGVSDXYEQDXSX5W.webp\"]','2025-11-29 05:40:17','2025-11-29 05:40:17',1),
(15,'Jett Knives Hoodie','jett-knives-hoodie',NULL,68,'Dash into sharp style with the VALORANT Jett Knives Hoodie!\n\nDesigned with bold character artwork and clean screenprinted details, this Jett hoodie lets you get on site, plant spike, protect spike, and go home in comfort.\n\nFeatures:\n\n- Custom pullover hoodie\n- 320 gsm 80% cotton, 20% polyester construction\n- Garment dyed, softhand plastisol screenprinted Jett graphics on center front, sleeves and back\n- VALORANT clip label on kangaroo pocket',1,'images/products/01KB7PSBHMNJ7V4HR9RVHCG1TF.jpg','[\"images\\/products\\/gallery\\/01KB7PSBHTQF8KN8W8699B0F41.webp\",\"images\\/products\\/gallery\\/01KB7PSBHZPJ0FJHTQ1A15A72H.webp\"]','2025-11-29 05:43:17','2025-11-29 05:43:17',1),
(16,'Hockey Puck Stress Ball','hockey-puck-stress-ball','This product is not intended as a toy or children\'s product.',10,'Immortalize every moment in your memory with the official VALORANT Masters Toronto merch collection and the Hockey Puck Stress Ball.\n\nFeatures:\n\n- 100% polyurethane stress ball\n- Printed VALORANT Masters graphics on both sides',1,'images/products/01KB7PXBSX8F5AZ55DMEFE2FNT.jpg','[\"images\\/products\\/gallery\\/01KB7PXBT1FX1YDWFVF6D0AQM7.webp\",\"images\\/products\\/gallery\\/01KB7PXBT7NES28Q3NC13M3FXB.webp\"]','2025-11-29 05:45:28','2025-11-29 05:45:28',1),
(17,'Chibi Sage Tee','chibi-sage-tee',NULL,35,'Tip the balance in your favor with the VALORANT Chibi Sage Tee!\n\nKeeping things straightforward with a soft, everyday fit and a reminder that your duty is definitely not over, our Chibi Sage Tee is inspired by Sages calm, commanding, and healing presence.\n\nFeatures:\n\n- Custom 100% cotton 30/1s tee\n- Garment dyed, softhand plastisol screenprinted Sage graphics on center front and center back neck\n- VALORANT clip label on bottom hem',1,'images/products/01KB7Q1YM9JXNZ11BMRWWZJNG6.jpg','[\"images\\/products\\/gallery\\/01KB7Q1YMDG609EF3RDWJBSV6B.webp\",\"images\\/products\\/gallery\\/01KB7Q1YMGG6A8M66HMYVS4T41.webp\"]','2025-11-29 05:47:59','2025-11-29 06:55:42',1),
(18,'5 Years XL Mousepad','5-years-xl-mousepad',NULL,35,'Celebrate 5 incredible years of aces, clutches, missed headshots, insane comebacks, new agents, maps, and so much more to come with the VALORANT 5 Years XL Mousepad!\n\nApproximate Dimensions:\n\n- Width: 31.3 in / 79.5 cm\n- Height: 11.8 in / 30 cm',1,'images/products/01KB7Q5HD58DWG5N7GM2KWJ0WT.jpg','[\"images\\/products\\/gallery\\/01KB7Q5HEH6TJKYTC5FXVG68CT.webp\",\"images\\/products\\/gallery\\/01KB7Q5HENFXPZN5P1D03DCRW1.webp\"]','2025-11-29 05:49:56','2025-11-29 05:49:56',1),
(19,'Nazar Bead Buddy Keychain','nazar-bead-buddy-keychain','This product is not intended as a toy or children\'s product.',16,'Bring your favorite gunbuddies from VALORANT to life with Series 1 of our Buddy keychains and the VALORANT Nazar Bead Buddy Keychain!\n\nEach Buddy Keychain comes with a ring and magnet to bring some tactical charm with you wherever you go.\n\nNazar Bead is number 1 of 9 in Series 1. Collect them all to complete your Buddy arsenal!',1,'images/products/01KB7QKQEQ6W50QK1PD4YTQWJT.jpg','[\"images\\/products\\/gallery\\/01KB7QKQG3BANFHMNJ8DJVDWK0.webp\",\"images\\/products\\/gallery\\/01KB7QKQG82KHN86PCYF5MNGY4.webp\",\"images\\/products\\/gallery\\/01KB7QKQGBMHVFB348ZK6F3AY4.webp\"]','2025-11-29 05:57:41','2025-11-29 05:57:41',1),
(20,'Dim Mak x Teamfight Tactics - Scratch Hoodie','dim-mak-x-teamfight-tactics-scratch-hoodie',NULL,175,'With the Dim Mak x Teamfight Tactics logos printed on front left chest, an oversized Scratch Little Legend graphic on back, and the Teamfight Tactics x Steve Aoki logo detail on left wrist, this black drawstring hoodie will keep you warm and looking fresh whether youre onstage or in game.\n\nMade with 80% cotton, 20% polyester. Machine wash cold and hang dry or lay flat. Do not dry clean. Screen printed in Los Angeles with love.',1,'images/products/01KB7QT9PMBV4CFN31X0BSDWNQ.jpg','[\"images\\/products\\/gallery\\/01KB7QT9PT3EFWXG48MAFFD71K.webp\"]','2025-11-29 06:01:17','2025-11-29 06:55:15',1),
(21,'RockLove ARCANE Jayce and Viktor Cog Necklace','rocklove-arcane-jayce-and-viktor-cog-necklace','This item typically ships within 1 month from purchase.',143,'Handcrafted in polished silver plated, nickel-free artisan brass, the Jayce and Viktor Cog Necklace is inspired by the very emblem of their partnership and progress. One side of the cog is pristine, engraved with Viktors quote: Two sides of the same coin, inextricably bound.\n\nThe other side of the cog is distorted by the Anomaly, with swirling, hand-applied pearlescent enamel in ethereal shades of pastel pink, purple, green, blue, and cream, capturing the unstable reality-bending energy that fractures their path in Season 2.\n\nNo two necklaces are alike; each piece is entirely one-of-a-kind. Strung through its center hole on a long adjustable silver plated brass curb chain, the pendant is fully reversible.\n\nFeatures:\n\n- Hand painted and swirled pearlescent enamel makes each piece truly unique!\n- Nickel-free artisan brass, enamel\n- Silver plated finish\n- 20 to 24 inch adjustable curb chain\n- 30mm x 30mm x 3mm\n\nApproximate Measurements:\n\nChain: 20.0 in / 50.8 cm + 4.0 in / 10.2 cm extender (24 in / 61.0 cm overall)\n',1,'images/products/01KB7R4F60VT02CR5HF90PWS97.jpg','[\"images\\/products\\/gallery\\/01KB7R4F65F22XAQXRG6ZNBQ4B.webp\",\"images\\/products\\/gallery\\/01KB7R4F6AD632KN0MF4W6E6WH.webp\",\"images\\/products\\/gallery\\/01KB7R4F6BPH31KNC0XFP8D15R.webp\",\"images\\/products\\/gallery\\/01KB7R4F6E7XXMWV9J4EG1HQBE.webp\"]','2025-11-29 06:06:50','2025-11-29 06:06:50',1),
(22,'Jayce Mercury Hammer Necklace','jayce-mercury-hammer-necklace','This item typically ships within 2 weeks from purchase.',122,'Handcrafted in nickel-free artisan brass with an antiqued finish, the Jayce Mercury Hammer pendant is intricately sculpted in three-dimensional detail to mirror the famed weapon that bridges science and power.\n\nUV-reactive enamel illuminates the hammers core, glowing bright blue under black light and in the dark, evoking the radiant pulse of Hextech energy. The pendant hangs from an adjustable antiqued brass curb chain, complete with a signature tag  a tribute to the genius, determination, and heart that drive Piltovers Defender of Tomorrow.\n\nFeatures:\n- UV-reactive enamel glows vibrant blue under black light and in the dark\n- Nickel-free artisan brass, enamel\n- Antiqued brass finish\n- 20 to 24 inch adjustable curb chain\n- 40mm x 16mm x 6mm (not including bail)\n\nApproximate Measurements:\n- Chain: 20.0 in / 50.8 cm + 4.0 in / 10.2 cm extender (24 in / 61.0 cm overall)\n\nThis jewelry collection arrives in a signature League of Legends | RockLove ARCANE Collector\'s Box, with gold metallic silkscreened art inside and out: a compelling addition to any display case.',1,'images/products/01KB7TNRFWNDGM6P2TVDEWJ502.jpg','[\"images\\/products\\/gallery\\/01KB7TNRG307G2C6SBBWMNBA56.webp\",\"images\\/products\\/gallery\\/01KB7TNRGBQZ0DXKFT0HR7XPY4.webp\",\"images\\/products\\/gallery\\/01KB7TNRGMS0S4JS8FNKVF1QW2.webp\",\"images\\/products\\/gallery\\/01KB7TNRGSGQ8RYNXCKPEEZ7JE.webp\"]','2025-11-29 06:51:14','2025-11-29 06:51:14',1),
(23,'Jinx Fishbones Hood','jinx-fishbones-hood',NULL,43,'Close out the final season of Arcane with an iconic piece straight out of Jinx\'s wardrobe with the Arcane Jinx Fishbones Hood.\n\nFeatures:\n\n- 100% heavyweight canvas hood construction\n- PU leather adjustable bodice\n- Contrast stitching teeth\n- Custom plastisol screenprinted graphics\n- Double signature grosgrain tassels',0,'images/products/01KB7V1KEEK3Z9YQQBPDQ4SVSS.jpg','[\"images\\/products\\/gallery\\/01KB7V1KEKEYTDT2VSBACK3ZAN.webp\",\"images\\/products\\/gallery\\/01KB7V1KETDP8P4F8PKN7NSEEW.webp\"]','2025-11-29 06:57:42','2025-11-29 06:57:42',1),
(24,'Naruto Sasuke Liquid Hat','narute-sasuke-liquid-hat',NULL,45,'- Official Valve product\n- Flexfit snapback\n- 100% cotton\n- Cap size 59cm\n- 6 panel cap',1,'images/products/01KB7V8M9339WHQ9XEAY2G5V8D.jpg','[\"images\\/products\\/gallery\\/01KB7V8M9AD6XXVPXS6E32JPBX.webp\",\"images\\/products\\/gallery\\/01KB7V8M9G12064Y175V1DV5RS.webp\"]','2025-11-29 07:01:32','2025-11-29 07:06:47',1),
(25,'Team Liquid Naruto Sasuke Distressed Sweatshirt Navy Blue','team-liquid-naruto-sasuke-distressed-sweatshirt-navy-blue','This item typically ships within 1 month from purchase.',140,'This LIQUID x NARUTO Sasuke Knit Sweater comes in a deep sea blue, Sasuke Uchicha facial outline and Sharingan cutting through the front. On the back is a white knit of his name in Japanese calligraphy and the abstract outline of Liquid\'s own mane.\n\n- Male model is 6?1 wearing a Medium\n- Female model is 5\'8 wearing a Small\n100% Cotton\nCotton drop needle knit sweater with Naruto intarsia artwork and exterior embroidered patch at wrist\n\n',0,'images/products/01KB7VGSJVACAAGBJR52CKDKE4.jpg','[\"images\\/products\\/gallery\\/01KB7VGSK33G7A8F8B63FRY1C2.webp\",\"images\\/products\\/gallery\\/01KB7VGSKB6H91A8NMZQ9E7SHE.webp\"]','2025-11-29 07:05:59','2025-11-29 07:05:59',1),
(26,'NAVI Half Zip Hoodie Emblem Black','navi-half-zip-hoodie-emblem-black',NULL,78,'Support your favorite esports with this product\nKey Product Attributes\n- FIT: INT REG\n- FABRIC: Double Pique;\n- 52% polyester Recycled,\n- 48% polyester;\n- 240.0 g/m Wicking; DRYCEL',1,'images/products/01KB7VT66XXQR40MKBVQ3EGJJY.jpg','[\"images\\/products\\/gallery\\/01KB7VT678H2P8FGPSNX9E84XS.webp\",\"images\\/products\\/gallery\\/01KB7VT67GHNY9SBTHFMPJ9B7Z.webp\"]','2025-11-29 07:11:07','2025-11-29 07:11:07',1),
(27,'Pro Jersey Blue','pro-jersey-blue',NULL,78,'Introducing the 2024 Team Liquid Official Jersey  your essential gear for victory. Crafted from polyester, this jersey combines style with unrivaled comfort, ideal for dominating the game or cheering us on from the sidelines.\n\n- 100% athletic grade polyester\n- Authentic pro team design\n- Moisture wicking\n- Antimicrobial\n- Fully sublimated design\n- Optional custom sublimated name on back',1,'images/products/01KB7WA7ENAVYZ02EQMSFZ9D0J.jpg','[\"images\\/products\\/gallery\\/01KB7WA7EWFPK7F5J5YB5WA1K6.webp\",\"images\\/products\\/gallery\\/01KB7WA7F40BEZ8K2EW6AR0B5Q.jpg\",\"images\\/products\\/gallery\\/01KB7WA7F9M59CWY82P495XYHK.avif\"]','2025-11-29 07:19:53','2025-11-29 07:19:53',1),
(28,'NaVi Pro Jersey','navi-pro-jersey','This item typically ships within 1 month from purchase.',125,'Step into the future of esports style with the NAVI x PUMA 2024 Pro Kit Jersey. Embracing bold colors beyond the classic black and yellow, this jersey symbolizes the dynamism and diversity of the NAVI community. Crafted for comfort and performance, wear it to show your NAVI pride!\n',1,'images/products/01KB7WG3M16TZT034J2D19S48D.png','[\"images\\/products\\/gallery\\/01KB7WG3MH5WMVRHW7WDWEXJED.png\",\"images\\/products\\/gallery\\/01KB7WG3MXRA3K9GNEGJC5GB39.png\"]','2025-11-29 07:23:06','2025-11-29 07:23:06',1),
(29,'Ninjas In Pyjamas Pro Jersey Multi','ninjas-in-pyjamas-pro-jersey-multi','This item typically ships within 1 month from purchase.',76,'This NIP Jersey was designed for the CSGO 2022 Rio Major.\n Support your favourite Esports community and wear it with a sense of collective belonging',1,'images/products/01KB7WTH3A2PQJSN0F4A4GCTPT.jpg','[\"images\\/products\\/gallery\\/01KB7WTH3NR6GDBGTYHSP97DW2.webp\",\"images\\/products\\/gallery\\/01KB7WTH3TTF8P3XE1YG7GHBNQ.webp\",\"images\\/products\\/gallery\\/01KB7WTH3YNK451HN1T3YZ5FCD.webp\"]','2025-11-29 07:28:47','2025-11-29 07:28:47',1);
